import React from 'react';
import iso from '../../styles/scss/form.module.scss';

const Inscription = () => {
  return (
    <section className="wrap">
      <form action="" className={`offset-2 col-8 form`+iso.form}>
        <fieldset>
          <div className="row">
            <input type="text" placeholder="Indiquez votre Pseudo"/>
          </div>
          <div className="row">
            <input type="text" placeholder="Indiquez votre mail"/>
          </div>
          <div className="row">
            <input type="text" placeholder="Choisissez un mot de passe"/>
          </div>
        </fieldset>
      </form>
    </section>
  )
}

export default Inscription;
